import React from 'react';
import Button from 'antd/lib/button';
import './App.css';
import Demo from './DirTree.js'
import { Layout } from 'antd';

const {
  Header, Footer, Sider, Content,
} = Layout;
function App() {
  return (
    <div className="App">
     <Layout>
      <Header></Header>
      <Layout>
      <Sider>Sider</Sider>
        <Content><Demo></Demo>
        <Button type="primary">Button</Button></Content>

        </Layout>

      <Footer></Footer>
    </Layout>

      </div>
  );
}


export default App;
